import React from 'react';

const Todos = props => {
  return (
    <div>
      <li>{props.todo}</li>
      <button onClick={props.deleteTask}>Mark Completed</button>
      <button onClick={props.deleteTask}>Delete Task</button>
    </div>
  );
};

export default Todos;

